@notice Calculates market price of $LOCKS
 @dev (fsl / supply) + ((psl / supply) * ((psl + fsl) / fsl)**5)
 @param _fsl Current fsl
 @param _psl Current psl
 @param _supply Current supply
 @return market $LOCKS market price

